    true,nt"url": null,nt"notes": "The Annual Statistical Supplement, 2001
    includes the most comprehensive data available on the Social Security and Supplemental
    Security Income programs. More than 250 statistical tables convey a wide range of
    information about those programs from beneficiary counts and benefit amounts to
    the status of the trust funds. The tables also contain data on Medicare, Medicaid,
    veterans' benefits, and other related income security programs. The Supplement also
    includes summaries of the history of the major programs and of current legislative
    developments and a glossary of terms used in explaining the programs and data.",nt"license_title":
